/* Dropify */
.dropify-wrapper {
  border: 2px dashed #2c2e33;
  background: transparent;
  border-radius: 7px; }
  .dropify-wrapper:hover {
    background-size: 30px 30px;
    background-image: -webkit-linear-gradient(135deg, #2e2f32 25%, transparent 25%, transparent 50%, #2e2f32 50%, #2e2f32 75%, transparent 75%, transparent);
    background-image: linear-gradient(135deg, #2e2f32 25%, transparent 25%, transparent 50%, #2e2f32 50%, #2e2f32 75%, transparent 75%, transparent);
    -webkit-animation: stripes 2s linear infinite;
    animation: stripes 2s linear infinite; }
  .dropify-wrapper .dropify-message span.file-icon:before {
    display: inline-block;
    font: normal normal normal 24px/1 "Material Design Icons";
    font-size: inherit;
    text-rendering: auto;
    line-height: inherit;
    -webkit-font-smoothing: antialiased;
    content: '\F552';
    color: #ffffff;
    font-size: 1.25rem; }
  .dropify-wrapper .dropify-message p {
    font-size: .8125rem;
    color: #ffffff; }
  .dropify-wrapper .dropify-preview .dropify-infos {
    background: rgba(255, 255, 255, 0.9); }
    .dropify-wrapper .dropify-preview .dropify-infos .dropify-infos-inner .dropify-filename {
      color: #0090e7;
      font-size: 20px;
      font-weight: 400; }
    .dropify-wrapper .dropify-preview .dropify-infos .dropify-infos-inner .dropify-infos-message {
      color: #333;
      font-weight: 500; }
  .dropify-wrapper .dropify-preview .dropify-render img {
    opacity: 0.7; }
  .dropify-wrapper .dropify-clear {
    background: #fff;
    border: none;
    font-weight: 700;
    color: #434a54; }

/* Dropzone */
.dropzone {
  border: 1px solid #2c2e33;
  min-height: 200px;
  background: transparent; }
  .dropzone .dz-message {
    text-align: center;
    width: 100%; }
    .dropzone .dz-message span {
      font-size: .8125rem;
      color: #ffffff; }
  .dropzone .dz-preview {
    margin: 5px; }
    .dropzone .dz-preview .dz-image {
      width: 63px;
      height: 63px;
      border-radius: 6px; }
    .dropzone .dz-preview .dz-error-message {
      top: 80px;
      left: -35px; }
    .dropzone .dz-preview .dz-success-mark,
    .dropzone .dz-preview .dz-error-mark {
      margin-left: -17px; }
      .dropzone .dz-preview .dz-success-mark svg,
      .dropzone .dz-preview .dz-error-mark svg {
        width: 35px;
        height: 35px; }

/* Flot chart */
.flot-chart-container {
  box-sizing: border-box;
  width: 100%;
  height: 100%;
  min-height: 300px;
  max-height: 100%; }

.flot-chart {
  width: 100%;
  position: relative;
  max-width: none;
  height: 400px; }
  .flot-chart canvas {
    position: absolute;
    top: 0;
    bottom: 0; }

/* Full Calendar */
.fc button {
  height: auto;
  background-image: none;
  text-shadow: none;
